import { StyledDiv, StyledTitle, StyledParagraph } from "./style"



export const AboutUs = () => {

  return (
    <StyledDiv> 

      <StyledTitle>Sobre Nós</StyledTitle>

      <StyledParagraph>
        Como desenvolvedores nossa missão é resolver problemas por meio da tecnologia e pensando nisso criamos essa plataforma com a missão de Ajudar ONGs que precisam de tecnologias, mas que não possuem recursos para contratar desenvolvedores, a implantarem tecnologias para divulgarem seus serviços e assim conseguir mais ajuda. e o outro problema que são os desenvolvedores recém formados, que muitas vezes deixam de conseguir uma vaga por não ter experiência. <br /> <br />
        Essa plataforma ajuda os dois lados, aqui o desenvolvedor Junior pode obter experiência e da melhor maneira, ajudando o próximo e o que fizer aqui vai para o portifólio e conta para a experiência quando o mesmo for se candidatar as vagas. Esse serviço é voluntario e o desenvolvedor pode fazer nas horas que combinar antes de entrar no projeto, dessa forma ajudamos a resolver esses dois problemas contribuindo dessa forma, com o nosso time de desenvolvedores.      
      </StyledParagraph>
    </StyledDiv> 
    
  )
}
